export interface IOverpayment {
    id? : string;
    nric?: string;
    discoveryDate?: string;
    trgStart?: string;
    trgEnd?: string;
    overpaymentType?: OverpaymentType;
    paymentType?: string;
    caseId?: string;
    overpaymentAmt?: number,
    outstandingPrincipalAmt?: number,
    outstandingInterestAmt?: number,
    totalOS?: number;
    totalRefund?: number;
}

export enum OverpaymentType {
    CHANGE_IN_PERIOD = 'CHANGE IN TRAINING PERIOD',
    CHANGE_IN_SERVICE_PAY_SV_ALLOWANCE = 'CHANGE IN SERVICE PAY',
    CHANGE_IN_AWARDS_ALLOWANCES = 'CHANGE IN AWARDS/ALLOWANCES',
    CHANGE_IN_MAKEUP_PAY_NA_ADJUSTMENT = 'CHANGE IN MUP (NA ADJUSTMENT)',
    CHANGE_IN_MAKEUP_PAY_WRONG_CLAIM = 'CHANGE IN MUP (WRONGFUL CLAIM)',
    CHANGE_IN_SERVICE_PAY_SV_ALLOWANCE_ELIGIBILITY = 'CHANGE IN SERVICE PAY ELIGIBILITY',
    OTHERS = 'OTHERS'
}
